num = ""
numbers = []
n = 0
while n < len(num):
    numbers.append(int(num[n:n+13]))
    n+= 1

production_of_numbers = []
for i in numbers:
    h = 1
    while i > 0:
        q = i % 10
        h *= q
        i = i // 10
    production_of_numbers.append(int(h))

print(max(production_of_numbers))
